import './index.css';


export default function SignIn() {
 
  const divStyle = {
    margin: '5px 0',
    padding:'5px',
    border:'1px solid #ccc'
};


  return (
    <div className={'b'}>
      <form>
        <label>Login</label>
        <br></br>
        <label>
          E-mail:
          <input type="text" name="Email"/>
        </label>
        <label>
          Senha:
          <input type="password" name="Email"/>
        </label>
      </form>
    </div>
  );
}
